import React from "react";
import "./App.css";
import { Provider } from "react-redux";
import CakeContainer from "./Components/CakeContainer";
const App = () => {
  return (
    <Provider>
      <div className="App">
        <CakeContainer />
      </div>
    </Provider>
  );
};

export default App;
